#define SDRAM_BASE            0xC0000000
#define FPGA_ONCHIP_BASE      0xC8000000
#define FPGA_CHAR_BASE        0xC9000000

/* Cyclone V FPGA devices */
#define LEDR_BASE             0xFF200000
#define HEX3_HEX0_BASE        0xFF200020
#define HEX5_HEX4_BASE        0xFF200030
#define SW_BASE               0xFF200040
#define KEY_BASE              0xFF200050
#define TIMER_BASE            0xFF202000
#define PIXEL_BUF_CTRL_BASE   0xFF203020
#define CHAR_BUF_CTRL_BASE    0xFF203030
#define PS2_BASE			  0xFF200100


/* VGA colors */
#define WHITE 0xFFFF
#define YELLOW 0xFFE0
#define RED 0xF800
#define GREEN 0x07E0
#define BLUE 0x001F
#define CYAN 0x07FF
#define MAGENTA 0xF81F
#define GREY 0xC618
#define PINK 0xFC18
#define ORANGE 0xFC00
#define BLACK 0x0000

/* Screen size. */
#define RESOLUTION_X 320
#define RESOLUTION_Y 240

#define FALSE 0
#define TRUE 1

#include <stdlib.h>
#include <stdio.h>
#include <stdbool.h>


volatile int pixel_buffer_start;
void swap(int* a, int* b);
int abs(int a);
void clear_screen();
void wait_for_vsync();

void draw_pixel(int x, int y, short int line_color);
void draw_box(int x, int y, short int line_color);
void draw_mainscreen();
void draw_background();

int i = 0; 
int current_position = 0; 

int main(void) {
	volatile int* pixel_ctrl_ptr = (int*)PIXEL_BUF_CTRL_BASE;
	*(pixel_ctrl_ptr + 1) = 0xC8000000;
	wait_for_vsync();
	pixel_buffer_start = *pixel_ctrl_ptr;

	clear_screen();

	*(pixel_ctrl_ptr + 1) = 0xC0000000;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);

	//PS/2 keyboard setup
	volatile int* PS2_ptr = (int*)PS2_BASE;
	int PS2_data, RVALID;
	char byte1 = 0, byte2 = 0, byte3 = 0,  key_pressed;
	bool KEY_I_PRESSED = FALSE;
	bool KEY_ENTER_PRESSED = FALSE;


	//clear the field (reset) 
	*(PS2_ptr) = 0xFF;

	clear_screen();


	//continue until enter or I is pressed to continue with the same 
	while (!KEY_I_PRESSED && !KEY_ENTER_PRESSED) {
		draw_mainscreen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);

		//check what key was pressed on the keyboard 
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;
		if (RVALID) {
			//shift the next data byte into the display 
			key_pressed = PS2_data;
			byte1 = byte2;
			byte2 = PS2_data & 0xFF;

			//check if the key pressed is enter or I for Instructions 
			if (key_pressed == 0x43) {
				printf("Instructions\n ");
				KEY_I_PRESSED = TRUE;
			}

			//press the Enter button to enter the game 
			if (key_pressed == 0x5A) {
				printf("Play the game\n");
				KEY_ENTER_PRESSED = TRUE;

			}
		}
	}

	//check which KEY was pressed 
	if (KEY_ENTER_PRESSED) {
		/*//clear_screen();
		wait_for_vsync();
		*(pixel_ctrl_ptr + 1) = 0xC0000000;
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		clear_screen();

		while (1) {
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);

			//draw the main background\
				printf("draw background\n"); 
			draw_background();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			draw_penguin(); 
		}*/


		clear_screen();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		clear_screen();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

		draw_background();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		draw_background();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		
		//drawing the penguin 
		while(1) {
	    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		draw_penguin(); 
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;

		//NEW CODE 
			//check if a or d is preesed (a = left d = right) 
		if (RVALID) {
			//shift the next data byte into the display 
			key_pressed = PS2_data & 0xFF;
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0x8000;

			//press the a button to move left 
			if (key_pressed == 0x1C && i % 2 == 0) {
				printf("pressed a\n");
				current_position = current_position - 2;
				printf("current a: %d\n", current_position); 
				i = 0; 
				draw_penguin();
			}

			//press the d button to move right 
			else if (key_pressed == 0x23 && i % 2 == 0) {
				printf("pressed d\n");
				current_position = current_position + 2;
				printf("current d: %d\n", current_position); 

				i = 0; 
				draw_penguin();
			}
			
			else if (key_pressed == 0xf0) {
				*(PS2_ptr) = 0xFF;
				printf("released");
				i++;
			}
			
			else { 
				printf("Nothing Pressed\n"); 
			}
		}

	}
}

	/*while (1) {
		printf("draw penguin\n"); 
		draw_penguin(); 
	} */
}

//beginning screen 	
void draw_mainscreen() {
	for (int x = 0; x < 320; x++) {
		for (int y = 0; y < 240; y++) {
			draw_pixel(x, y, game_title[y][x]);
		}
	}
}

//game play screen 
void draw_background() {
	printf("Inside background\n");
	for (int x = 0; x < 320; x++) {
		for (int y = 0; y < 240; y++) {
			draw_pixel(x, y, background[y][x]);
		}
	}
}

//draw pemguin 
void draw_penguin() {
	for (int x = 0; x < 68; x++) {
		for (int y = 0; y < 68; y++) {
			draw_pixel(x + 50 + current_position, y + 180, penguin[y][x]);
		}
	}
}

void draw_pixel(int x, int y, short int line_color)
{
	*(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


void wait_for_vsync() {
	volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
	register int status;

	*pixel_ctrl_ptr = 1;

	status = *(pixel_ctrl_ptr + 3);

	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
}



void clear_screen() {
	for (int x = 0; x < RESOLUTION_X; x++) {
		for (int y = 0; y < RESOLUTION_Y; y++) {
			draw_pixel(x, y, 0);
		}
	}
}


void swap(int* a, int* b) {
	int temp;
	temp = *a;
	*a = *b;
	*b = temp;
}

int abs(int a) {
	if (a < 0) {
		return -a;
	}
	return a;
}













